import React, { useState } from 'react';
import axios from 'axios';

const OperationForm = () => {
    const [formData, setFormData] = useState({
        id: '',
        client_name: '',
        operation_name: '',
        business_link: '',
        description: '',
        financial_instrument: '',
        sector: '',
        sub_sector: '',
        country: ''
    });

    useEffect(() => {
        // Fetch existing operations to populate the dropdown
        axios.get('http://localhost:8000/api/operations/')
            .then(response => {
                setFormData(response.data);
            })
            .catch(error => console.error('Error fetching operations:', error));
    }, []);

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({ ...FormData, [name]: value });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        if (formData.id) {
            // Update existing operation
            axios.put(`http://localhost:8000/api/operations/${formData.id}/`, formData)
                .then(response => {
                    console.log('Operation updated:', response.data);
                })
                .catch(error => console.error('Error updating operation:', error));
        } else {
            // Create new operation
            axios.post('http://localhost:8000/api/operations/', formData)
                .then(response => {
                    console.log('Operation created:', response.data);
                    setFormData({ ...formData, id: '' }); // Reset form
                })
                .catch(error => console.error('Error creating operation:', error));
        }
    };

    const handleSelectChange = (e) => {
        const selectedId = e.target.value;
        if (selectedId) {
            const selectedOperation = FormData.find(op => op.id === parseInt(selectedId));
            setFormData(selectedOperation);
        } else {
            setFormData({
                id: '',
                client_name: '',
                operation_name: '',
                business_link: '',
                description: '',
                financial_instrument: '',
                sector: '',
                sub_sector: '',
                country: ''
            });
        }
    };

    return (
        <div>
            <h2>Operation Form</h2>
            <form onSubmit={handleSubmit}>
                <label>
                    ID:
                    <select name="id" value={FormData.id} onChange={handleSelectChange}>
                        <option value="">Select ID</option>
                        {operations.map(op => (
                            <option key={op.id} value={op.id}>{op.id}</option>
                        ))}
                    </select>
                </label>
                <br />
                <label>
                    Client Name:
                    <input type="text" name="client_name" value={FormData.client_name} onChange={handleChange} />
                </label>
                <br />
                <label>
                    Operation Name:
                    <input type="text" name="operation_name" value={FormData.operation_name} onChange={handleChange} />
                </label>
                <br />
                <label>
                    Business Link:
                    <input type="text" name="business_link" value={FormData.business_link} onChange={handleChange} />
                </label>
                <br />
                <label>
                    Description:
                    <textarea name="description" value={FormData.description} onChange={handleChange}></textarea>
                </label>
                <br />
                <label>
                    Financial Instrument:
                    <input type="text" name="financial_instrument" value={FormData.financial_instrument} onChange={handleChange} />
                </label>
                <br />
                <label>
                    Sector:
                    <input type="text" name="sector" value={FormData.sector} onChange={handleChange} />
                </label>
                <br />
                <label>
                    Sub Sector:
                    <input type="text" name="sub_sector" value={FormData.sub_sector} onChange={handleChange} />
                </label>
                <br />
                <label>
                    Country:
                    <input type="text" name="country" value={FormData.country} onChange={handleChange} />
                </label>
                <br />
                <button type="submit">Submit</button>
            </form>
        </div>
    );
};

export default OperationForm;
